#include <string>
#include <iostream>

using namespace std;


bool checkPass(string s, int front, int end){
    for(int i=front;i<end-1;i++)
    {
        for (int j=i+1;j<end;j++)
        {
            if(s[j]==s[i])
                return false;
        }
    }
    return true;

}

bool checkNumber(string s, int n)
{
    for(int i=0;i<=s.size()-n;i++)
    {
        if(checkPass(s,i,i+n))
        {
            return true;
        }

    }
    return false;
}

int findSubStringBinary(string s, int left, int right)
{
    if(left==right-1)
    {
        if(checkNumber(s,right))
            return right;
        else
            return left;

    }
    else if(left==right)
    {
        return left;
    }
    else
    {
        int bin_ = (left+right)/2;
        if(checkNumber(s,bin_))
        {

            return findSubStringBinary(s,bin_,right);
        }
        else
        {

            return findSubStringBinary(s,left,bin_);
        }

    }


}

int lengthOfLongestSubstring(string s){
    if(s.size()==0)
        return 0;
    else
        return findSubStringBinary(s,1,s.size());



}

